// <T
export const tComponentMerger = {
    initial: 0 /* S.Idle */,
    step: (state, t, end) => {
        const type = t.customType;
        const token = t.token;
        switch (state) {
            case 0 /* S.Idle */:
                if (type === 'tag.regular.begin') {
                    return 1 /* S.ExpectT */;
                }
                break;
            case 1 /* S.ExpectT */:
                if (type === 'tag.name' && token === 'T') {
                    return end.MERGE_ALL;
                }
        }
    },
    customType: 'trigger.t.component',
};
